public class InnerDataSourceConfluenceConfigurationFactory(Action<Humidifier.Kendra.DataSourceTypes.ConfluenceConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Kendra.DataSourceTypes.ConfluenceConfiguration>
{

    internal InnerDataSourceConfluenceAttachmentConfigurationFactory AttachmentConfigurationFactory { get; set; }

    internal InnerDataSourceConfluencePageConfigurationFactory PageConfigurationFactory { get; set; }

    internal InnerDataSourceConfluenceBlogConfigurationFactory BlogConfigurationFactory { get; set; }

    internal InnerDataSourceDataSourceVpcConfigurationFactory VpcConfigurationFactory { get; set; }

    internal InnerDataSourceConfluenceSpaceConfigurationFactory SpaceConfigurationFactory { get; set; }

    protected override Humidifier.Kendra.DataSourceTypes.ConfluenceConfiguration Create()
    {
        var confluenceConfigurationResult = CreateConfluenceConfiguration();
        factoryAction?.Invoke(confluenceConfigurationResult);

        return confluenceConfigurationResult;
    }

    private Humidifier.Kendra.DataSourceTypes.ConfluenceConfiguration CreateConfluenceConfiguration()
    {
        var confluenceConfigurationResult = new Humidifier.Kendra.DataSourceTypes.ConfluenceConfiguration();

        return confluenceConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Kendra.DataSourceTypes.ConfluenceConfiguration result)
    {
        base.CreateChildren(result);

        result.AttachmentConfiguration ??= AttachmentConfigurationFactory?.Build();
        result.PageConfiguration ??= PageConfigurationFactory?.Build();
        result.BlogConfiguration ??= BlogConfigurationFactory?.Build();
        result.VpcConfiguration ??= VpcConfigurationFactory?.Build();
        result.SpaceConfiguration ??= SpaceConfigurationFactory?.Build();
    }

} // End Of Class

